INSERT INTO `blogi` VALUES (1,'admin','<h2>P&auml;ivityksi&auml;</h2>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>\r\n<p style=\"padding-left: 30px;\">Sivulle on lis&auml;tty moderaattoreille uutisten kirjoittamis mahollisuus, jotka p&auml;ivittyv&auml;t&nbsp;v&auml;litt&ouml;m&auml;sti t&auml;h&auml;n etusivulle. T&auml;st&auml; l&auml;htien kaikki uudetasiat/muutokset tullaan&nbsp;julkaisemaan t&auml;ss&auml; ja my&ouml;s Jonin tarinatki p&auml;&auml;setv&auml;t varmasti omaan rooliinsa.</p>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>\r\n<p style=\"padding-left: 30px;\">T: Admin.</p>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>\r\n<p style=\"padding-left: 30px;\">&nbsp;</p>','1346886165'),(2,'jon','<h1>Suuri ja mahtava KKK</h1>\r\n<h4>Osa 1/8</h4>\r\n<p>Olipa kerran kkk joka oli suuri ja mahtava travian pelaaja. H&auml;nen edess&auml; polvistuivat itse deto ja redokin vikisten armoa. Mutta sek&auml;&auml;n ei riitt&auml;ny t&auml;lle suurelle mahtiruhtinaalle joka hallitsi riuskalla ottellaan armoa antamatta travianin suomen speed servua.</p>\r\n<p>&nbsp;</p>\r\n<p>Er&auml;&auml;n&auml; p&auml;iv&auml;n&auml; kuitenkin kaikki liittoutuivat h&auml;nt&auml; vastaan (speed 13) ja siit&auml; alkoi 100 p&auml;iv&auml;inen sota. Vain harvat jatkoivat taistelua antautumatta kkk:riveiss&auml; antautumatta rikkauksille joita vastapuoli yritti heille tarjota puolen vaihtamistest (mm. MJ, Jon^^, erkki, Shariana). Taistelut olivat suuria ja verisi&auml;, mutta aina niist&auml; on yli p&auml;&auml;sty.</p>\r\n<p>&nbsp;</p>\r\n<p>Miten tarina jatkuu? Muista katsoa seuraava jakso!</p>','1346886414'),(3,'kkk','<p>Jeesh,</p>\r\n<p>&nbsp;</p>\r\n<p>Eli huomattiin t&auml;s ett&auml; travian ei p&auml;ivit&auml; map.sql -tiedostoo p&auml;ivitt&auml;in t&auml;ydellisesti, niin kaikki delenneet kyl&auml;t ei katoo heti seuraavana p&auml;iv&auml;n&auml;. T&auml;&auml; on siis travianin vika, ei meij&auml;n.</p>\r\n<p>Idleaikoihin t&auml;&auml; ei kuitenkaan vaikuta.</p>\r\n<p>&nbsp;</p>\r\n<p>-Kekkkonen</p>','1347118256'),(4,'kkk','<p>http://screencast.com/t/2hKjqjwFaLOI</p>','1347406743');
